import { Component } from '@angular/core';
import { Router } from '@angular/router';
import { AuthService } from '@services/AuthService';

@Component({
  selector: 'app-login',
  templateUrl: './login.component.html',
  styleUrls: ['./login.component.css']
})
export class LoginComponent {
  email: string = '';
  password: string = '';
  errorMessage: string = '';
  loading: boolean = false;

  constructor(
    private authService: AuthService,
    private router: Router
  ) {}

  login() {
    if (!this.email || !this.password) {
      this.errorMessage = 'Tots els camps són obligatoris';
      return;
    }

    this.loading = true;
    this.authService.login(this.email, this.password).subscribe(
      (response: any) => {
        this.loading = false;
        // Guardar el token
        localStorage.setItem('token', response.token);
        // Redirigir a home
        this.router.navigate(['/home']);
      },
      (error: any) => {
        this.loading = false;
        this.errorMessage = error.error.message || 'Error en el login';
      }
    );
  }

  registerLink() {
    this.router.navigate(['/register']);
  }
}
<div class="login-container">
  <div class="login-box">
    <h1>Login - Bookio.net</h1>

    <div *ngIf="errorMessage" class="error">
      {{ errorMessage }}
    </div>

    <form (ngSubmit)="login()">
      <div class="form-group">
        <label>Email:</label>
        <input
          type="email"
          [(ngModel)]="email"
          name="email"
          placeholder="email@example.com"
          required
        />
      </div>

      <div class="form-group">
        <label>Contrasenya:</label>
        <input
          type="password"
          [(ngModel)]="password"
          name="password"
          placeholder="Contrasenya"
          required
        />
      </div>

      <button type="submit" [disabled]="loading">
        {{ loading ? 'Conectant...' : 'Login' }}
      </button>
    </form>

    <p class="register-link">
      No tens compte?
      <a (click)="registerLink()" style="cursor: pointer; color: #3498db;">
        Registra't aquí
      </a>
    </p>
  </div>
</div>
